// src/pages/admin/Dashboard.jsx
import { useEffect, useState } from "react";
import { getAdminDashboard } from "../../services/adminApi";
import StatCard from "../../components/admin/StatCard";
import LatestTable from "../../components/admin/LatestTable";

const Dashboard = () => {
  const [stats, setStats] = useState(null);
  const [latest, setLatest] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    getAdminDashboard()
      .then((res) => {
        setStats(res.data.statistics);
        setLatest(res.data.latest);
      })
      .finally(() => setLoading(false));
  }, []);

  if (loading) return <p className="text-center mt-10">Loading...</p>;

  // Helper: transform image fields to <img> element
  const renderImage = (url) =>
    url ? (
      <img src={url} alt="img" className="h-12 w-12 object-cover rounded" />
    ) : (
      "-"
    );

  return (
    <div className="p-6 space-y-8">
      {/* ===== Statistics ===== */}
      <div className="grid grid-cols-2 md:grid-cols-4 lg:grid-cols-8 gap-4">
        <StatCard title="Users" value={stats.users} />
        <StatCard title="Categories" value={stats.categories} />
        <StatCard title="Products" value={stats.products} />
        <StatCard title="Customers" value={stats.customers} />
        <StatCard title="Orders" value={stats.orders} />
        <StatCard title="Employees" value={stats.employees} />
        <StatCard title="Sales" value={stats.sales} />
        <StatCard title="Reservations" value={stats.reservations} />
      </div>

      {/* ===== Latest Tables ===== */}
      <div className="space-y-6">
        <LatestTable
          title="Latest Users"
          data={latest.users}
          columns={[
            { key: "id", label: "ID" },
            { key: "name", label: "Name" },
            { key: "email", label: "Email" },
            { key: "role", label: "Role" },
            { key: "status", label: "Status" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Categories"
          data={latest.categories}
          columns={[
            { key: "id", label: "ID" },
            { key: "cate_image", label: "Image", render: renderImage },
            { key: "title_en", label: "Title" },
            { key: "description_en", label: "Description" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Products"
          data={latest.products}
          columns={[
            { key: "id", label: "ID" },
            { key: "product_image", label: "Image", render: renderImage },
            { key: "title_en", label: "Title" },
            { key: "description_en", label: "Description" },
            { key: "price", label: "Price" },
            { key: "quantity", label: "Quantity" },
            { key: "category_id", label: "Category" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Customers"
          data={latest.customers}
          columns={[
            { key: "id", label: "ID" },
            { key: "name", label: "Name" },
            { key: "email", label: "Email" },
            { key: "status", label: "Status" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Orders"
          data={latest.orders}
          columns={[
            { key: "id", label: "ID" },
            { key: "title_en", label: "Title" },
            { key: "description_en", label: "Description" },
            { key: "price", label: "Price" },
            { key: "quantity", label: "Quantity" },
            { key: "customer_id", label: "Customer" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Employees"
          data={latest.employees}
          columns={[
            { key: "id", label: "ID" },
            { key: "name", label: "Name" },
            { key: "email", label: "Email" },
            { key: "salary", label: "Salary" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Sales"
          data={latest.sales}
          columns={[
            { key: "id", label: "ID" },
            { key: "title_en", label: "Title" },
            { key: "description_en", label: "Description" },
            { key: "price", label: "Price" },
            { key: "quantity", label: "Quantity" },
            { key: "employee_id", label: "Employee" },
            { key: "created_at", label: "Date" },
          ]}
        />

        <LatestTable
          title="Latest Reservations"
          data={latest.reservations}
          columns={[
            { key: "id", label: "ID" },
            { key: "name", label: "Name" },
            { key: "email", label: "Email" },
            { key: "persons", label: "Persons" },
            { key: "date", label: "Date" },
            { key: "time", label: "Time" },
            { key: "message", label: "Message" },
            { key: "status", label: "Status" },
            { key: "created_at", label: "Created At" },
          ]}
        />
      </div>
    </div>
  );
};

export default Dashboard;
